color <- function(max,min,res){
  if (!is.na(res)) {
    if (!is.na(max)){
      if (res>=max){
        color <- 'red'
      } else {
        color <- 'White'
      }
    }
    
    if (!is.na(min)){
      if (res<=min){
        color <- 'red'
      } else {
        color <- 'White'
      }
    }
  } else {
    color <- 'black'
  }
  return(color)
}

